import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Home from './Home';
import SingleMovies from './SingleMovies';
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/movies/:id" element={<SingleMovies/>} />
    </Routes>
    </BrowserRouter> 
    </>
  );
}

export default App;
